import React, { useState } from 'react';
import './Template.css'
// import ScrollToTop from "react-scroll-to-top";
import { Link as Scroll } from 'react-scroll';
import user from '../Assests/user.png'
export default function Template() {
  const [showDropdown, setShowDropdown] = useState(false);

  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };
  return (
    <div>
    <div className='main'>
      <nav>
        <ul>
        <li><a href="#" className=''>Home</a></li>
          <li><a href="#" className='gal'>Gallery</a></li>
          <li><a href="#" className='res'>Reserve</a></li>
          <li className="user-profile" onClick={toggleDropdown}>
            <a href="#"><img className="user" src={user} alt="Logo"/></a>
            {showDropdown && (
              <ul className="dropdown">
                <li><a href="#">Account</a></li>
                <li><a href="#">Settings</a></li>
                <li><a href="#">Logout</a></li>
              </ul>
            )}
          </li>
        </ul>
      </nav>
    </div>

    {/* -------------------This is Gallery Page-------------------- */}
    <div className='gallery'>
    const imageUrls = [
    'url1.jpg',
    'url2.jpg',
    'url3.jpg',
    'url4.jpg',
    'url5.jpg',
    'url6.jpg',
    'url7.jpg',
    'url8.jpg',
  ];
  {imageUrls.map((imageUrl, index) => (
        <img key={index} src={img1} alt={`Image ${index + 1}`} />
      ))}

    </div>
    </div>
  )
}
